import { useEffect, useState } from "react";

export default function Traps() {
    
    [data, setData] = useState("Loading...")

    useEffect(() => {
        fetch("http://localhost:8000/").then(response => response.json()).then(json => {console.log(json)})
    })
    
    return(
      <>
        {data}
      </>  
    );
}
